import React from 'react'
import { SliderContainer, SliderToggle } from './VolumeSliderElements';

const soundIcon = require("../../images/soundIcon.svg").default;

const VolumeSlider = () => {
  return (
    <SliderContainer>
      <SliderToggle src={soundIcon} />

      /* <SliderSection>
        <MusicIcon />
        <Slider type="range" min="1" max="100" value="50"/>
      </SliderSection>

      <SliderSection>
        <SoundIcon />
        <Slider type="range" min="1" max="100" value="50"/>
      </SliderSection> */

    </SliderContainer>
  )
}

export default VolumeSlider
